description:
   NOVA and National Geographic present exclusive access to an astounding discovery of ancient fossil human ancestors. Deep in a South African cave, a special team of experts has brought to light an unprecedented wealth of fossils belonging to a crucial gap in the record of our origins that spans the transition between the ape-like australopithecines (such as the famous Lucy) and the earliest members of the human family. At the center of the discovery is paleoanthropologist Lee Berger, a character brimming with enthusiasm and opinions, whose claims have stirred long controversy in the contentious field of human origins. Join NOVA to solve a two million year-old &quot;crime scene&quot; and dig into extraordinary new clues about what made us human.


